import React from "react"

function add(number01, number02){
    let addition = number01 + number02;
    return addition
}

function sub(number01, number02){
    let subtract = number01 - number02;
    return subtract 
}

function div(number01, number02){
    let divition = number01/number02;
    return divition
}

function mult(number01, number02){
    let multiplication = number01 * number02;
    return multiplication
}

export default add;
export {sub, div, mult}
